                "\u0429\u0435\u0431\u0435\u043D\u044C 20-40 - \u043D\u0435\u043E\u0431\u0445\u043E\u0434\u0438\u043C \u0434\u043B\u044F \u0434\u0440\u0435\u043D\u0430\u0436\u043D\u044B\u0445 \u0438 \u0444\u0443\u043D\u0434\u0430\u043C\u0435\u043D\u0442\u043D\u044B\u0445 \u0440\u0430\u0431\u043E\u0442;",
                "\u0429\u0435\u0431\u0435\u043D\u044C 40-70 - \u043F\u0440\u0438\u043C\u0435\u043D\u044F\u0435\u0442\u0441\u044F \u0434\u043B\u044F \u0434\u043E\u0440\u043E\u0436\u043D\u044B\u0445 \u0438 \u043F\u0440\u043E\u0447\u0438\u0445 \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0445 \u0440\u0430\u0431\u043E\u0442;", 
