            "\u0421\u0442\u0430\u043D\u0434\u0430\u0440\u0442\u043D\u044B\u0439 \u0434\u0440\u043E\u0431\u043B\u0435\u043D\u044B\u0439 \u043A\u0430\u043C\u0435\u043D\u044C \u0438\u043C\u0435\u0435\u0442 \u0444\u0440\u0430\u043A\u0446\u0438\u044E \u0440\u0430\u0437\u043C\u0435\u0440\u043E\u043C \u043E\u0442 5 \u0434\u043E 70 \u043C\u043C \u0438 \u0432\u044B\u0448\u0435. \u0417\u0435\u0440\u043D\u0430 \u043F\u043E\u0440\u043E\u0434\u044B \u043E\u0442 0,1 \u0434\u043E 5 \u043C\u043C \u043D\u0430\u0437\u044B\u0432\u0430\u044E\u0442\u0441\u044F \u043E\u0442\u0441\u0435\u0432\u043E\u043C."
